import './App.css';
import Link from './Components/Link';

const handleLink = (event)=>
{
  event.preventDefault();
}

function App() {
  return (
    <div className="">
      <header className="App-header">
        <h2>Interview Hub</h2>
        <Link handleClick={handleLink} to={"/confirmExam"}>Text</Link>
      </header>
    </div> 
  );
}

export default App;
